(36322, '855B5F70-32C4-4670-9BC4-7D45A606FCF0', 'Lauren just revived this froM an ER doctor in the Bay Area: it’s long but worth the read.   TLDR:  this shit’s real and scary beyond what’s being reported.   This is from a friend who is an ER doc near San Fran - First of all let me say that there are only a few people who can truly describe the actual impact this virus has caused. Your regular doctor or specialist will likely have NO clue what is happening on the front lines. Certainly no politician will have any idea the immense toll this is taking on our systems. My two hospitals that I work at have the highest number of COVID positive patients in the US. One is a large academic center and the other is a community hospital. I have seen people from 20-90 come in with a cough one day and die 8 days later. All of the young ones are healthy non smokers and athletic. The virus itself does part of the havoc. It is your immune response that goes insane and your body essentially drowns itself. Once you are at that point you will most certainly die. We currently cannot keep up with the influx of patients. A paper just got released showing that 32 of 33 intubated patients died. The average age was 56. That is a small study and I know for a fact we had a 27 yo die or is dying. Healthy female. If you take medications  .Are overweight. Smoke. Or are older than 9 years old. You are at higher risk. Social distancing and agressive hygiene along with frequent testing is the only way to survive this.  I’ve stopped listening to people who do not work in the ED. As EVERY covid patient in the world has come through the emergency department.  Every day I see on average a handful of people die. It’s not in the Media because those departments are overworked and are not required to report it. Stay home. Don’t risk your health and your families Health. Likely Monday all domestic flights will be cancelled. Kids are high risk vectors that will transmit to adults. I’m actually scared to go to work and see people as are all of my colleagues. But if we didn’t no one would. Surgeons are not coming down to see patients. They want us to face time them they are too afraid they will get sick. Use your mind and stay home.', 'David', 'Nitzan', '2020-03-15T10:07:12.922215'),
